    <>
    <div><div class="carus swiffy-slider slider-item-show4 slider-nav-outside slider-nav-dark slider-nav-sm slider-nav-visible slider-nav-page slider-item-snapstart slider-nav-autoplay slider-nav-autopause slider-item-ratio slider-item-ratio-contain slider-item-ratio-32x9 bg-white shadow-lg py-3 py-lg-2" data-slider-nav-autoplay-interval="2000">
    <div class="slider-container">
        <div><img src="../assets/img/brandlogos/css-3.svg" alt="..."/></div>
    </div>

    <button type="button" class="slider-nav" aria-label="Go left"></button>
    <button type="button" class="slider-nav slider-nav-next" aria-label="Go left"></button>

</div></div>    
    </>

  )
}

export default Carusel
